import React, { Component } from 'react';

import SitterJobList from 'components/Jobs/ListViewSitterJobs/SitterJobList';

class ViewSitterJobs extends Component {
    render() {
        const { data } = this.props;
        return (
            <div>
                <SitterJobList data={data} />
            </div>
        );
    }
}

export default ViewSitterJobs;
